import SideNavBar from "../Components/SideNavBar";
import NavBar from "../Components/NavBar";
import Box from "@mui/material/Box";
import {Button,Dialog,DialogTitle,DialogContent,DialogContentText} from "@mui/material";
function AddVideo() {
  return (
    <>
      <NavBar />
      <Box height={30} />
      <Box sx={{ display: "flex" }}>
        <SideNavBar />

        <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
          <h1>AddBook</h1>
          <Button color="primary" variant="contained" >AddBook</Button>
          <Dialog>
            <DialogTitle>UserScreen</DialogTitle>
            <DialogContent>
                <DialogContentText>This </DialogContentText>
            </DialogContent>
          </Dialog>
        </Box>
      </Box>
    </>
  );
}
export default AddVideo;
